INSERT INTO `category` (`ID`, `Name`, `Image`, `Discription`) VALUES
(2, 'BANDSAW', 'Amada.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH BANSAW IS ONE OF IT. IN BANDSAW THERE ARE DIFFERENT CATEGORIES ARE AVAILABLE LIKE VERTICAL AND HORIZONTAL BANDSAW. WE HAVE MACHINES AVAILABLE AT OUR WAREHOUSE IN BAKROL AND ALANG OF DIFFERENT MAKES AND SIZE. PLEASE CONTACT US FOR YOUR REQUIREMENT AND WE WILL PROVIDE YOU WITH THE SUITABLE MACHINE AS PER YOUR REQUIREMENT.'),
(3, 'BORING', 'SIP.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH BORING IS ONE OF IT. IN BORING DIFFERENT CATERGORIES ARE AVAILABLE LIKE HORIZONTAL AND JIG BORING OF DIFFERENT MANUFACTURER LIKE TOS, SIP, FMUA, ETC. IT CAN BE STARTED UNDER POWER AT OUR WAREHOUSES.\r\nPLEASE CONTACT US FOR YOUR NEED AND IF PARTICULAR MACHINE IS NOT AVAILABLE WE CAN IMPORT THE SAME AS PER YOUR REQUIREMENT.\r\n\r\n'),
(4, 'CENTERLESS GRINDER', 'SZIM.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH CENTRELESS GRINDER IS ONE OF IT. \r\nWE HAVE MACHINES AVAILABLE AT OUR WAREHOUSE IN BAKROL AND ALANG OF DIFFERENT MAKES AND SIZE. PLEASE CONTACT US FOR YOUR REQUIREMENT.\r\n'),
(5, 'CNC TURNING', 'HAAS.jpg', '\r\nWE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH CNC TURNING IS ONE OF IT. DIFFERENT MAKES AND SIZE ARE AVAILABLE. PLEASE CONTACT US FOR YOUR NEED AND IF PARTICULAR MACHINE IS NOT AVAILABLE WE CAN IMPORT THE SAME AS PER YOUR REQUIREMENT.\r\n'),
(6, 'CNC VTL', 'Dalian_Guofeng.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH CNC VTL IS ONE OF IT.\r\n\r\nPLEASE CONTACT US FOR YOUR NEED AND WE WILL PROVIDE YOU WITH THE SUITABLE MACHINE AS PER YOUR REQUIREMENT.\r\n\r\n'),
(7, 'GEAR BASED MACHINERY', 'cometa.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH GEAR BASED IS ONE OF IT. DIFFERENT SIZE AND MAKES ARE AVAILABE FROM DIFFERENT MANUFACTURER LIKE HOFLER, REISHAUER, WMW, TOS, ETC. DIFFERENT CATEGORIES IN IT ARE GEAR TESTER, GRINDER, HOBBING, RELIEVING LATHE, SHAPER, ETC.\r\nWE CAN PROVIDE YOU WITH THE FOLLOWING MACHINES RIGHT NOW AND IF YOU HAVE DIFFERENT REQUIREMENT LET US KNOW.\r\n'),
(8, 'MILLING MACHINES', 'ADCOCK_SHIPLEY.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH MILLING MACHINE IS ONE OF IT. WE HAVE DIFFERENT CATEGORIES AVAILABLE WITH US WHICH ARE TURRET MILLING, DUAL SPINDLE, UNIVERSAL, VERTICAL, BED TYPE, ETC. DIFFERENT SIZE AND MAKES ARE AVAILABLE. \r\n\r\nCONTACT US AND TELL US YOUR REQUIREMENT SO WE CAN GUIDE YOU FOR THE SAME. \r\n\r\nCURRENTLY WE HAVE STOCK OF THE FOLLOWING MACHINES.\r\n'),
(9, 'PLANO MILLER', 'Sarabsukh.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH PLANO MILLER IS ONE OF IT.\r\nWE HAVE MACHINES FROM DIFFERENT MANUFACTURER LIKE BEGHINI, PIETRO CARNAGHI AND LOCAL MADE SARAB SUKH, ETC. \r\n\r\nCONTACT US AND TELL US YOUR REQUIREMENT SO WE CAN GUIDE YOU FOR THE SAME. \r\n'),
(10, 'RADIAL DRILL', 'breda.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH RADIAL DRILL IS ONE OF IT. WE HAVE MACHINES FROM DIFFERENT MANUFACTURER LIKE MAS, KAO MING, TAIPIN, OOYA, BREDA, ETC. WE HAVE FOLLOWING RANGE OF ARM LENGTH VARYING FROM 700 TO 2350 MM.\r\nCONTACT US AND TELL US YOUR REQUIREMENT SO WE CAN GUIDE YOU FOR THE SAME. \r\n            WE CAN OFFER YOU THE FOLLOWING LISTED MACHINERY.\r\n'),
(11, 'ROTARY SURFACE GRINDER', 'OERLIKON.jpg', '\r\nWE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH SURFACE GRINDER IS ONE OF IT.\r\nWE HAVE DIFFERENT VARIETY OF IMPORTED SURFACE MACHINERY AVAILABLE WITH US OF DIFFERENT SIZE AND MAKE. THE DIFFERENT MADE AVAILABLE ARE FAVRETTO, PROTH, ACER, KENT, ELB , OKAMOTO, BROWN & SHARPE, STANKO, ETC. WE HAVE BOTH THE CATEGORIES HYDRAULIC AND MANUAL. \r\n\r\nPLEASE CONTACT US FOR YOUR REQUIREMENT SO WE CAN GUIDE YOU WITH THE SUITABLE MACHINERY.\r\n'),
(12, 'SHAPING', 'Bombay.jpg', 'IN THIS CATEGORY WE HAVE BOTH LOCAL AND IMPORTED MACHINERY AVAILABLE WITH US FROM SIZE 450 MM TO 810 MM. CONTACT US FOR MORE INFORMATION.'),
(13, 'SLOTTING', 'Waldrich.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH SLOTTING IS ONE OF IT.\r\nWE HAVE MACHINES AVAILABLE AT OUR WAREHOUSE CONTACT US TO KNOW MORE.\r\n\r\n'),
(14, 'SURFACE GRINDER', 'ACER.jpg', '\r\nWE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH SURFACE GRINDER IS ONE OF IT.\r\nWE HAVE DIFFERENT VARIETY OF IMPORTED SURFACE MACHINERY AVAILABLE WITH US OF DIFFERENT SIZE AND MAKE. THE DIFFERENT MADE AVAILABLE ARE FAVRETTO, PROTH, ACER, KENT, ELB , OKAMOTO, BROWN & SHARPE, STANKO, ETC. WE HAVE BOTH THE CATEGORIES HYDRAULIC AND MANUAL. \r\n\r\nPLEASE CONTACT US FOR YOUR REQUIREMENT SO WE CAN GUIDE YOU WITH THE SUITABLE MACHINERY.\r\n'),
(15, 'TOOL AND CUTTER GRINDER', 'Praga.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH TOOL AND CUTTER GRINDER IS ONE OF IT. WE HAVE MACHINES AVAILABLE OF DIFFERENT MAKES LIKE CINCINNATI, TOS HOSTIVAR, ETC. \r\nALL THE MACHINES ARE IN GOOD CONDITION AND YOU CAN TEST IT UNDER POWER AT OUR WAREHOUSE.\r\n'),
(16, 'VMC', 'Feeler.jpg', '        WE HAVE DIIFERENT VMC AVAILABLE AT OUR WAREHOUSE FROM REPUTED MANUFACTURERS LIKE HAAS, FEELER. ALL THE MACHINES ARE IN EXCELLENT CONDITION AND CAN BE TESTED UNDER POWER. \r\nPLEASE CONTACT US SO WE CAN HELP YOU TO BUY A SUITABLE MACHINERY FOR YOUR REQUIREMENT.\r\n\r\n\r\n'),
(17, 'VTL', 'Micromake.jpg', '\r\nWE HAVE LOCAL VTL MACHINES AVAILABLE WITH US WHICH ARE IN GOOD CONDITION. THE MAKE AVAILABLE WITH US ARE PUNJSTEEL, MICROMAKE, ETC. \r\n\r\nPLEASE CONTACT US SO WE CAN GUIDE YOU.\r\n'),
(18, 'CYLINDRICAL GRINDER', 'MSO.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH CYLINDRICAL GRINDER IS ONE OF IT.\r\nDIFFERENT SIZE AND MAKE AVAILABLE WITH ID/OD, HYDRAULIC, MANUAL AND ONLY WITH OD, ETC. WE HAVE MACHINES OF DIFFERENT MANUFACTURER LIKE KARSTENS, JONES AND SHIPMAN, TOS HOSTIVAR, ETC.\r\nPLEASE CONTACT US FOR YOUR REQUIREMENT SO WE CAN SERVE YOU WITH YOUR REQUIREMENT.\r\n'),
(19, 'LATHE', 'lathe.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH LATHE IS ONE OF IT. WE HAVE LATHE AVAIALABLE AT OUR WAREHOUSE IN ALANG FROM REPUTED MANUFACTURER LIKE NAMSUN, DAINICHI,STANKO,CHOLCHESTER. PLEASE CONTACT US FOR YOUR REQUIREMENT SO WE CAN SERVE YOU WITH YOUR REQUIREMENT.'),
(20, 'PILLAR DRILL', 'pillar.jpg', 'WE ARE IMPORTER AND DEALER OF USED IMPORTED MACHINERY IN WHICH PILLAR DRILL IS ONE OF IT. WE HAVE LATHE AVAIALABLE AT OUR WAREHOUSE IN ALANG FROM REPUTED MANUFACTURER LIKE YOSHIDA, PRVOMAJSKA, DAINICHI,ARBOGA. PLEASE CONTACT US FOR YOUR REQUIREMENT SO WE CAN SERVE YOU WITH YOUR REQUIREMENT.');
